INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("青空の下で謁見", 5118061, "フリーマーケット会場", 40, 91002, 7, 10118, "ペコリーヌとの出会い", 1, 0, 2, 0, 8, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 2834);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("未来の騎空団\nマスコット？", 5118062, "フリーマーケット会場", 40, 91002, 7, 10118, "マホとの出会い", 1, 0, 2, 0, 8, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 2835);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("お嬢さまからの\n緊急依頼", 5118063, "ランドソル市街地", 40, 91002, 7, 10118, "アキノとの出会い", 1, 0, 2, 0, 8, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 2837);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("黄金色の悩みごと", 5118064, "フリーマーケット会場", 40, 91002, 18, 10118, "ジュンとの出会い", 1, 0, 2, 0, 8, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 4108402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("白熱！　格闘大会！", 5118065, "フリーマーケット会場", 40, 91002, 18, 10118, "カオリとの出会い", 1, 0, 2, 0, 8, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 4107402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("祭り太鼓はオーエドの華", 5118066, "オーエド町", 40, 91002, 16, 10118, "ニノンとの出会い", 1, 0, 2, 1, 8, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 9000227);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("人気者は遅れて\nやってくる", 5118067, "フリーマーケット会場", 40, 91002, 19, 10118, "スズナとの出会い", 1, 0, 3, 0, 8, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 2101181);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("巫女・ミーツ・魔法少女", 5118068, "ランドソル市街地", 40, 91002, 18, 10118, "ナナカとの出会い", 1, 0, 3, 0, 8, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 4109402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("ネズ耳は二度なくなる", 5118069, "フリーマーケット会場", 40, 91002, 18, 10118, "キャル＆コッコロとの出会い", 1, 0, 3, 0, 8, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 4305402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("この出会いにカンパイ！", 5118070, "ランドソル市街地", 40, 91002, 18, 10118, "ユカリとの出会い", 1, 0, 3, 0, 8, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 4101402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("陰陽アンサンブル", 5118071, "ランドソル市街地", 40, 91002, 18, 10118, "アオイとの出会い", 1, 0, 3, 0, 8, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 4106402);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("運試し十番勝負！", 5118072, "フリーマーケット会場", 40, 91002, 7, 10118, "シノブとの出会い", 1, 0, 3, 1, 8, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 2836);
INSERT INTO `v1_a3d9f5e5f2b98bedd59c7580c635959090837454daaf3addb5e5290913cf8318` VALUES ("彼女たちの新たな日常", 5118600, 0, 0, 0, 0, 10118, "オープニング", 0, 10145115, 1, 0, 0, 0, 0);
